import React from 'react';
import styled from 'styled-components';

const Card = styled.div`
  width: 150px;
`;

const MoviePoster = ({ i }) => {
  return (
    <>
      <Card>
        <img src={'/img/poster' + (i + 1) + '.jpg'} width="100%" />
      </Card>
    </>
  );
};

export default MoviePoster;
